import XTermTerminal from '../components/xterm.js';

const TerminalPage = () => {
  return (
    <div style={{ padding: '20px' }}>
      <h1>Terminal Page</h1>
      <XTermTerminal />
    </div>
  );
};

export default TerminalPage;
